import React from "react";
import "../App.css";
import { Button } from "./Button";
import "./HeroSection.css";

function HeroSection() {
  return (
    <div className="hero-container">
      <video class="video" loop muted autoPlay preload="auto">
        <source src="/videos/Yosuke_v2.mp4" type="video/mp4" />
      </video>

      <h1>Sakana Sushi Bar & Japanese Cuisine</h1>
      <p>DINE-IN & PICK UP AVAILABLE</p>
      {/* <a class="button" href="https://www.customer2you.com/SakanaSushiBar.nsf/" target="_blank">
        <span>Order Online</span>
      </a> */}
      <div className='hero-btns'>
        <Button
          className='btns'
          buttonStyle='btn--outline'
          buttonSize='btn--large'
        >
          GET STARTED
        </Button>
        <Button 
          className='btns'
          buttonStyle='btn--primary'
          buttonSize='btn--large'
          onClick={console.log('hey')}
        >
          ORDER ONLINE <i className='far fa-play-circle' />
        </Button>
      </div>
    </div>
  );
}

export default HeroSection;
